import axios from "axios";
import auth_header from "./auth_header";

export const activeLinks = () => {
  return axios
      .get('localhost../customer/order',{ headers: auth_header() })
      .then((response) => {
        return response.data;
      });
};

export const inviteUser = (inviteData) => {
  return axios
      .post('http://localhost:3600/admin/invite/', { headers: auth_header(), inviteData })
      .then((response) => {
        return response.data;
      });
};
